import Login from './pages/Login';
import './App.css';
import Signup from './pages/Signup';
import { BrowserRouter, Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <BrowserRouter>
          <Route path='/'>
            <Login />
          </Route>
        </BrowserRouter>
      </header>
    </div>
  );
}

export default App;
